(626, 'Как так?', 'Значимость этих проблем настолько очевидна, что сложившаяся структура организации позволяет выполнять важные задания по разработке позиций, занимаемых участниками в отношении поставленных задач. Равным образом новая модель организационной деятельности влечет за собой процесс внедрения и модернизации дальнейших направлений развития. С другой стороны новая модель организационной деятельности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития.', 'image2.jpg', '2019-06-07 12:09:04', 0, 39),
